import React from "react";

// import image
import landingImg from "../img/landingImg.jpg";

// import materia-ui components
import { makeStyles } from "@material-ui/core/styles";
import { Box, Grid } from "@material-ui/core";

// custom css styling
const useStyles = makeStyles({
  coverImg: {
    height: "100vh",
    width: "100vw",
    backgroundImage: `url(${landingImg})`
  },
  textWhite: {
    color: "white"
  }
});

function Front() {
  const classes = useStyles();

  return (
    <>
      <div className={classes.coverImg}>
        <Box
          justifyContent="center"
          alignItems="center"
          display="flex"
          flexDirection="column"
          style={{ height: "100vh" }}
          bgcolor="text.disabled"
        >
          <Box textAlign="center">
            <h1 style={{ fontSize: "70px" }} className={classes.textWhite}>
              Jay Kim
            </h1>
            <p style={{ fontSize: "30px" }} className={classes.textWhite}>
              Full Stack Developer
            </p>
          </Box>
          <Grid container direction="row" justify="center" alignItems="center" textAlign="center">
            <Grid container item xs={2} textAlign="center">
              <a href="#about">About</a>
            </Grid>
            <Grid container item xs={2}>
              <a href="#projects">Projects</a>
            </Grid>
            <Grid container item xs={2}>
              <a href="#contact">Contact</a>
            </Grid>
          </Grid>
        </Box>
      </div>
    </>
  );
}

export default Front;
